import React from 'react';
import { Link, NavLink, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { useEffect, useState } from 'react';



const Cccanhan = () => {
    const [Nhansu, setNhansu] = useState([]);
    const [year, setYear] = useState('');

    const currenturl = window.location.href;
    const timid = new URLSearchParams(currenturl);
    const idns = timid.get('idns');

    useEffect(() => {
        axios.get(`http://localhost:3000/nhansu/${idns}`)
            .then(Response => {
                if (Response.data) {
                    setNhansu(Response.data);
                } else {
                    alert(Response.data);
                }
            })
            .catch(err => console.log(err));
    }, [idns]);

    const handleYearChange = (event) => {
        setYear(event.target.value);
    };

    const handleSubmit = () => {
        // Do something with the 'year' value, like sending it to the server
        // For example:
        // axios.post('http://localhost:3000/saveAttendance', { idns, year })
        //     .then(_res => {
        //         // Handle success
        //     })
        //     .catch(err => {
        //         // Handle error
        //     });
    };

    return (
        <div>
            Chấm Công Cho
            {Nhansu.map(e => (
                <div key={e.id}>{e.Ten}</div>
            ))}
            <div>
                <label>nam:</label>
                <input
                    type="number"
                    id='inputNam'
                    placeholder='Nhap nam'
                    className=''
                    autoComplete='off'
                    value={year}
                    onChange={handleYearChange}
                    required
                />
            </div>
            <button className='' onClick={handleSubmit}>
                Lưu
            </button>
        </div>
    );
};

export default Cccanhan;
